import React from "react"
import Img from "./Img"
import Form from "./Form"

class App extends React.Component{
    constructor(props){
        super(props)
    }

    render(props){
        //https://api.imgflip.com/get_memes
        return(
            <div id='app'>
                <Form/>
                <Img/>
            </div>
        )
    }
}

export default App;
